import React from "react";
import "./ConnectSection.css";

const ConnectSection = () => {
  return (
    <section className="connect-section">
      {/* SECTION 1 */}
      <div className="connect-top">
        <h2>Connect Based on Shared Interests</h2>
        <p>
          Discover partners who align with your goals, ideas, and industries.
          We make it easier to connect smartly.
        </p>

        <div className="connect-boxes">
          {[
            "Interest-Based Matching",
            "Vision Alignment",
            "Smart Connections",
            "Partnership Success",
          ].map((item, index) => (
            <div key={index} className="connect-box">
              {item}
            </div>
          ))}
        </div>
      </div>

      {/* SECTION 2 */}
      <div className="connect-bottom">
        <h2>Ready to Find Your Business Partners?</h2>
        <p>
          Connect with people in your industry who share your goals and values.
          Let‚Äôs build meaningful partnerships together.
        </p>

        <div className="connect-buttons">
          <div className="connect-btn">Similar Industries</div>
          <div className="connect-btn">Shared Interests</div>
        </div>
      </div>
    </section>
  );
};

export default ConnectSection;
